import {searchService} from './searchService';

export const searchActions ={
    getSearchedRepo,
}

function getSearchedRepo(username) {
    return dispatch => {
      return searchService.getSearchedRepo(username)
        .then(
          res => {
            return dispatch(res);
          },
          error => {
            return dispatch(error);
          }
        );
    };
    
  }
